// --------------------------------------------------------
// AXI Stream 유틸리티 함수들
inline ap_uint<32> pop_stream_uint32(const AXI_VAL &e) {
    #pragma HLS INLINE
    return e.data.range(31, 0);  // 전체 32비트 사용
}

inline AXI_VAL push_stream_uint32(ap_uint<32> const &v, bool last = false) {
    #pragma HLS INLINE
    AXI_VAL e;
    e.data = v;  // 전체 32비트 할당
    e.strb = -1;
    e.keep = 15;
    e.user = 0;
    e.last = last ? 1 : 0;
    e.id = 0;
    e.dest = 0;
    return e;
}


