// 입출력 처리 함수들
void load_input(D_TYPE *target, AXI_VAL *source);
void store_output(AXI_VAL *target, D_TYPE *source);

// --------------------------------------------------------
// 이진 언패킹 함수 (CPU 전처리 대신)
void unpack_binary_input(
    D_TYPE input_data[INPUT_WORDS],     // CPU에서 이진화된 25개 32비트 워드
    ap_uint<1> output_data[IMG_H*IMG_W] // 784개 1비트 픽셀
);

