// Top-level 함수 (AXI Stream 인터페이스, 배치 처리)
void mnist_cnn_top(
    AXI_VAL input_stream[BATCH_SIZE * 25],           // 배치 사이즈 × 25개 32비트 워드
    AXI_VAL output_stream[BATCH_SIZE * FC_OUTPUT]    // 배치 사이즈 × 10개 출력 logits
);

